import axios from "axios"
import {useState} from "react"
let App=()=>{
  let [title,settitle]= useState("")
  let [data,setData] = useState(" ")
  let fun =()=>{
    axios.get(`http://localhost:5000/getbytitle/${title}`).then((res)=>{
      setData(res.data)
    }).catch((err)=>{
      console.log(err)
    })
  }
  return(
    <div>
      <div>
      <input type="text" value={title} onChange={(e)=>settitle(e.target.value)} placeholder="enter title"/>
      <button onClick={fun}>GetResult</button>
      </div>
      {data!=null && data !==" " && 
      <div>
        <h1>title :{data.title}</h1>
        <h1>description :{data.marks}</h1>
      </div>}
      {data==null && <div>Check student id</div>}
    </div>
  )
}
export default App
